const ErrorModal = (props) => {
  return (
    <Card className={classes.modal}>
      <hearder>
        <h2>{props.title}</h2>
      </hearder>

      <div>
        <p>{props.messsage}</p>
      </div>

      <footer>
        <Button>Okay</Button>
      </footer>
    </Card>
  );
};

export default ErrorModal;
